from mpmath import mp
from math import *


mp.dps = 150
real_e = list("")

z = [2,1]

for j in range (0,99):
    e = 0

    if j % 3 == 0:
        z.append(2*(j//3)+2)
    else:
        z.append(1)

    zi = reversed(z)

    for i in zi:
        e = mp.mpf(1/(e + i))

    e = 1/e

    e = list(str(e))
    for k in range(2,len(e)):
       if int(real_e[k-2]) - int(e[k]) != 0:
           print("(", j, ",", k-2, ")")
           break


